import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
      
    //App
    appContainer:{
        width: 490,
    },
    
    //Header
    header:{
        alignItems:'center',
        backgroundColor:'#d96c06',
        flexDirection:'row',
        height:80, 
        padding:5,  
    },

    textheader:{
        fontSize:18,
        fontWeight:'bold',
        fontStyle:'italic',
        
    },

    textheader1:{
        justifyContent:"center",
        marginLeft:5,
     
     },

    imgheader:{
        height: 40,
        width:40,
        padding:25,
        marginLeft:5,
    },

    // Content
    content:{
        alignItems:'center',
        backgroundColor:'#2292a4',
        width:490,
        
    },

    content1:{
        // alignContent:'center',
        backgroundColor:'#f5efed',
        height:150,
        justifyContent:'center',
        width:300,
    },

    textContent:{
        flex:1,
        fontSize:18,
        fontWeight:'bold',
        marginTop: 50,
        textAlign:'center',
    },

    linhaContent:{
        marginBottom:20,
    },

    linhaContent1:{
        flexDirection:"column",

    },

    linhaContent2:{
        flexDirection:'row',
        justifyContent:'center',
        
    },

    imgContent2:{
        height:300,
        width:600,
       
    },

    textContent1:{
        fontSize:12,
        fontWeight:'bold',
    },

    imgContent:{
        height:400,
        marginTop:50,
        width:600,
    },

    imgContent1:{
        height:300,
        marginTop:50,
        width:600,
    },



    //Informações

    informacao:{
        justifyContent:'center',
        marginLeft:20,
        marginRight:20,
    },

    boasVindas:{
        fontSize:16,
        fontWeight:"bold",
        marginTop:50,
    },

    info:{ 
        fontSize:15,
        fontStyle:'normal',
        fontWeight:'bold',
    },

    info1:{ 
        fontSize:15,
        fontStyle:'normal',
    },

    infoImc:{
        fontSize:15,
        fontStyle:'italic'
    },

   // Imc
   imcContent2:{
    alignItems:'center',
    borderBottomWidth:1,
    justifyContent:'center',
    marginLeft:80,
    width:450,
},

linha1:{
    alignItems:'center',
    flexDirection:'row',
    borderStyle:'solid',
},

imcLinha:{
    borderRadius:5,
    borderWidth:1,
    borderStyle:'solid',
    margin:20,
    width:160,
    
},

imcLinha1:{
    fontFamily:"AnotherFont",
    color:'red',
    
},

touchImc:{
    borderWidth:1,
    borderRadius:5,
    marginBottom:20,
    width:100,
    shadowRadius:3,

},

touchText:{
    textAlign:'center',
},




    //Footer
    footer:{
        alignItems:"center",
        backgroundColor:'#D96c06',
        flexDirection:'row',
        justifyContent:'center',
        height:70,
        
    },

    textFooter:{
        padding:20,
    },
   

})
